//       primary: {
//         main: "#F9C959",
//       },
//     },
//   });
// }

ReactDOM.render(
  <React.StrictMode>
    {/* <ThemeProvider theme={theme} /> */}
    <Provider store={store}>
      <BrowserRouter>
        <App />
      </BrowserRouter>
    </Provider>
  </React.StrictMode>,
  document.getElementById("root")
);
reportWebVitals();
